import{faComments, faShareSquare, faPrayingHands} from "@fortawesome/free-solid-svg-icons";

function SentBubble({SentMessage}) {
    return (
        <div className="bg-transparent flex justify-around items-center">



            <div className="flex justify-start p-1 text-sm font-light">
                <div className="p-3 max-w-xs bg-gray-100 rounded-t-xl rounded-br-xl bg-gray-300 text-gray-700">
                    <p>{SentMessage}</p>
                </div>

            </div>

            <div>
                <TrashIcon className ="h-7 w-7 text-gray-400"/>
            </div>
            <div>
                <FontAwesomeIcon icon={faPrayingHands} size ={'2x'} className="text-gray-400 p-1.5"/>
            </div>





        </div>

    )
}

export default SentBubble;
